import { connect } from 'react-redux'
import { setLoggedinUser } from './actions'
import AddFavorite from './AddFavorite'

const mapStateToProps = (state, ownProps) => ({
  user: state.loggedinUser
})

export default connect(
  mapStateToProps
)(AddFavorite)
